shared_ptr output_tensor = static_pointer_cast(output_data_vec[0]);
// Convert the buffer of the obtained result to the float type.
float * result =(float *)output_tensor->GetBuffer();
int label_index = 0;
float max_value = 0.0;
// Traverse to search for the largest category subscript and the corresponding confidence value.
for(int i=0; iGetSize()/sizeof(float) ; i++)
{
    if(*(result + i) > max_value)
    {
        max_value = *(result + i);
        label_index = i;
    }
}
// Display the result. 
printf("label index:%d, Confidence :%f\n", label_index, max_value);

